import React from "react";
import { Link } from "react-router-dom";

import "./header.css";

const header = () => {
  return (
    // <div classname="Header">
    <header>
      <nav>
        <ul>
          <li>
            <Link to="/home">Acceuil</Link>
          </li>
          <li>
            <Link to="/service">Service</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </nav>
    </header>
    // </div>
  );
};

export default header;
